  return (
    <div>
      <header></header>
      <main>
        <Switch>
          <Route path="/" exact>
            <Redirect to="/quote-form" />
          </Route>
          <Route path="/quote-form">
            <QuoteForm />
          </Route>
          <Route path="/quote-form">
            <QuoteForm />
          </Route>
        </Switch>
      </main>
    </div>
  );
}

export default App;
